import React from 'react';
import Article from './Article';
import './_Article.scss'

class ArticleList extends React.Component{

  render() {
    const articlesData = this.props.articles;

	let articles = articlesData.map( (articles) =>
	  <li key={articles.id}><Article articleItem={articles} /></li>
	)

	return(
	  <div className="article-wrap">{articles}</div>
	)
  }
}
export default ArticleList;
